INSERT INTO `contents` (`id`, `page`, `title`, `description`, `contents`, `image`, `link`, `status`, `created_at`, `updated_at`) VALUES
(1, 1, 'Island hopping', 'Island hopping', 'Once confirmed, island hopping tours can be cancelled up to 36 hours prior to tour start. Within 36 hours of tour start, cancellation fees of IDR 450’000 per group will be levied. In case of heavy rain, and up to two hours before tour start, cancellation of the tour will be effectuated free of charge. Guests can elect to get a full refund of the tour or a re-schedule for a later day.', NULL, NULL, 1, '2020-03-19 11:02:07', '2020-03-20 13:15:27'),
(2, 1, 'Island hopping', 'Island hopping', 'Driver will wait up to 15 minutes at meeting point. Delayed guests will face a penalty of IDR 50’000 per hour of waiting.', NULL, NULL, 1, '2020-03-19 11:20:16', '2020-03-19 12:24:19'),
(3, 1, 'Island hopping', 'Island hopping', 'Island hopping packages include a series of services that are detailed in the offer. Additional services can be purchased on board the boat and paid in full before being used. Pick up is usually at 16:00. Guests that come back early might have a longer waiting time for pickup. However, the company with put its best endeavours to collect easts before 16:00.', NULL, NULL, 1, '2020-03-19 11:24:11', '2020-03-19 12:24:28'),
(4, 1, 'Payment terms', NULL, 'Payments are to be made before the service commences, except for metered taxi. Payments must be made in full and in cash, bank transfer, PayPal, credit or debit card. No services will be rendered if payment is not effectuated in full. Down payments may be asked for some bookings to guarantee third parties services remain available on the day of the booking. Such down payments are usually not refundable.', NULL, NULL, 1, '2020-03-19 11:24:32', '2020-03-19 11:24:32'),
(5, 1, 'Payment terms', 'addsa', 'Specific refund policies are described in the relevant sections below. Unless specified otherwise in conditions below and outside of peak season, bookings can be cancelled up to 48 hours before the start of the trip.', NULL, NULL, 1, '2020-03-19 11:24:58', '2020-03-20 13:14:48'),
(6, 1, 'Payment terms', NULL, 'All settlements done via PayPal will attract an additional 3.5% surcharge and 2.6% via credit/debit card.', NULL, NULL, 1, '2020-03-19 11:25:08', '2020-03-19 11:25:08'),
(7, 1, 'Airport transfers', NULL, 'Airport transfers can either be with meter (standard) or at fixed price (return fares, agreed prices as part of a tour).', NULL, NULL, 1, '2020-03-19 11:26:25', '2020-03-19 11:26:25'),
(8, 1, 'Airport transfers', NULL, 'Fixed-price airport transfers are direct from the airport to the hotel or from the hotel to the airport. Stop-overs requested by guests on the way will attract additional charges, either based on meter or defined by head office and confirmed to the driver. The airport promotion offered on the website is reserved to Belitung residents and from airport to personal home only. These rates are not available for outside guests.', NULL, NULL, 1, '2020-03-19 11:26:41', '2020-03-19 11:26:41'),
(9, 1, 'Car rentals with driver', NULL, 'Outside of peak season, car rentals with driver can be cancelled up to 36 hours before start at no fee.', NULL, NULL, 1, '2020-03-19 11:27:55', '2020-03-19 11:27:55'),
(10, 1, 'Car rentals with driver', NULL, 'Within 36 hours of tour start, car rentals can be cancelled for of fee of IDR 150’000 per vehicle.', NULL, NULL, 1, '2020-03-19 11:28:05', '2020-03-19 11:28:05'),
(11, 1, 'Car rentals with driver', NULL, 'The stated fees include the car rental, the driver and the fuel only. Meals, entrance fees, parking, souvenirs and other incidentals are excluded from the rental costs.', NULL, NULL, 1, '2020-03-19 11:28:21', '2020-03-19 11:28:21'),
(12, 1, 'Car rentals with driver', NULL, 'Car rentals with driver shall terminate at 20:00 but a maximum of 12 hours. Additional hours will be charged at IDR 30’000 per hour.', NULL, NULL, 1, '2020-03-19 11:28:34', '2020-03-19 11:28:34'),
(13, 1, 'Leebong island tours', NULL, 'Once confirmed, Leebong tours can be can cancelled up to 48 hours before the tour start. Within 48 hours of tour start, cancellation fees of IDR 400’000 per person will be levied. In case of heavy rain, and up to two hours before tour start, cancellation of the tour will be effectuated free of charge. Guests can elect to get a full refund of the tour or a re-schedule for a later day.', NULL, NULL, 1, '2020-03-19 11:29:30', '2020-03-19 11:29:30'),
(14, 1, 'Leebong island tours', NULL, 'Passengers who fail to be at meeting point in time thus causing a delay for transportation might not be picked-up by the driver. In such cases, the tour will not be refunded but can be rescheduled for a fee of IDR 350’000 group.', NULL, NULL, 1, '2020-03-19 11:29:51', '2020-03-19 11:29:51'),
(15, 1, 'Self-drive car rentals and motorbike rentals', NULL, 'Rentals are governed by the signed rental agreement that guests will fill at arrival. A deposit based on the rental value and the service chosen will be levied at arrival. Deposits can be made in cash or with card, either in IDR or in selected international currencies (please check with head office beforehand). Deposits will be refunded in full at the end of the rental if the vehicle is returned in condition set forth in the rental agreement.', NULL, NULL, 1, '2020-03-19 11:30:31', '2020-03-19 11:30:31'),
(16, 1, 'Self-drive car rentals and motorbike rentals', NULL, 'Car rentals can be cancelled within 24 hours of start and 48 hours of start at no cost. Past this deadline, a day rental charge will be charged to the guest. Fuel and parking fees ate to be paid by the guests.', NULL, NULL, 1, '2020-03-19 11:30:45', '2020-03-19 11:30:45'),
(17, 1, 'Belitung island tours, thematic tours', NULL, 'Outside of peak season, tours can be cancelled up to 36 hours before start at no fee. Within 36 hours of tour start, Belitung island tours and thematic tours can be cancelled for of fee of IDR 150’000 per vehicle.', NULL, NULL, 1, '2020-03-19 11:31:07', '2020-03-19 11:31:07'),
(18, 1, 'Belitung island tours, thematic tours', NULL, 'Tours includes services specified in the offer. Additional services are at the cost of the guest.', NULL, NULL, 1, '2020-03-19 11:31:20', '2020-03-19 11:31:20'),
(19, 1, 'Belitung island tours, thematic tours', NULL, 'Car rental, petrol and driver are included in the tour, but only if the itinerary is followed strictly. Changes in itinerary may attract additional charges and drivers will confirm them with head office before accepting alterations to the route.', NULL, NULL, 1, '2020-03-19 11:31:35', '2020-03-19 11:31:35'),
(20, 1, 'Other activities', NULL, 'For all bookings that need to be paid in advance (notably hotel bookings, special dinners, events, etc.), booking can only be guaranteed once down payment was made.', NULL, NULL, 1, '2020-03-19 11:31:57', '2020-03-19 11:31:57'),
(21, 1, 'Other activities', NULL, 'For all the above, no refund will be made in case of cancellation.', NULL, NULL, 1, '2020-03-19 11:32:09', '2020-03-19 11:32:09'),
(22, 1, 'qwqwq', NULL, 'sdcsd', NULL, NULL, 0, '2020-03-19 11:48:40', '2020-03-19 11:48:47'),
(23, 1, 'Ram nagar', NULL, 'dsfsdfsjkd cusgd d hrkshjfsjkf hhklh', NULL, NULL, 0, '2020-03-19 11:49:08', '2020-03-19 11:49:16'),
